import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Navbar from "./Navbar";
import Home from "./pages/Home";
import Prediction from "./pages/Prediction";
import TreatmentOption from "./pages/TreatmentOption";
import AboutUs from "./pages/AboutUs";

import LandingPage from "./loginpages/LandingPage";
import LoginPage from './loginpages/LoginPage';
import RegisterPage from './loginpages/RegisterPage';

function App() {
  return (
    <div className="vh-100 gradient-custom">
      <div className="container">
        <h1 className="page-header text-center"></h1>

        <Router>
          <Navbar />
          <div className="Container">
            <Routes>
              <Route path="/" element={<LandingPage />} />
              <Route path="/login" element={<LoginPage />} />
              <Route path="/register" element={<RegisterPage />} />
              <Route path="/home" element={<Home />} />
              <Route path="/prediction" element={<Prediction />} />
              <Route path="/treatmentoption" element={<TreatmentOption />} />
              <Route path="/aboutus" element={<AboutUs />} />
            </Routes>
          </div>
        </Router>
      </div>
    </div>
  );
}

export default App;
